import { useState, useEffect } from 'react';
import axios from 'axios';


// const useFetch =(url) => {
//     const fetch = async () => {
//       const result = await axios(url);
//       return result.data
//     };

//   };



  export default (url) => {
    const [roleMapping, setRoleMapping] = useState({});

    useEffect((url) => {
        async (url) => {
            const result = await axios(url);
            setRoleMapping(result.data)
          };
    }, []);
    return roleMapping;
  }
